import Button from "../../Button";

const En_Hero = ({ prod, title, get }) => {
  return (
    <section className="fullSection h-screen padding flex-col justify-between">
      <h1>{title}</h1>
      <div className="grid grid-cols-5 gap-2">
        {prod.heroAbilities.map((item, index) => {
          return (
            <div className="text-center">
              <h2>{item.title}</h2>
              <h6>{item.describe}</h6>
            </div>
          );
        })}
        <Button label={"Get " + title} to={get} />
      </div>
    </section>
  );
};

export default En_Hero;
